import React from 'react';

const Title = () => {
  return (
    <div className="title">
      <h1>FotoGrid</h1>
      <h2> Real Time Photobook  </h2>
      <p> Suggest you trying out image storage features on this site </p>
    </div>
  )
}

export default Title;
